import React from "react";
import styled from "styled-components";
import { NavbarContainer, Logo } from "../styles/NavbarStyles";
import LogoSvg from "../assets/steamLogo.svg"; // Ajusta la ruta según sea necesario

const StyledLogo = styled.img`
  width: 100px; // Ajusta el tamaño según lo necesites
  height: auto; // Mantiene la proporción
`;

function Navbar() {
  return (
    <>
      <NavbarContainer>
        <StyledLogo src={LogoSvg} alt="Logo de Steam" />
      </NavbarContainer>
    </>
  );
}

export default Navbar;
